import React from 'react';
import PropTypes from 'prop-types'; // Import PropTypes for type checking
import ball1 from '../ball1.png';

function ProductCard({ id, image, description, title, price, onBuyClick }) {
  return (
    <div key={id} className="card">
      <div className="img">
        <img src={image} className="product-img" alt={title} />
      </div>
      <div className="desc">{description}</div>
      <div className="title">{title}</div>
      <div className="box">
        <div className="price">{`${price} ETH`}</div>
        <button className="btn-store" onClick={() => onBuyClick(id)}>
          Buy
        </button>
      </div>
    </div>
  );
}

ProductCard.propTypes = {
  id: PropTypes.number.isRequired,
  image: PropTypes.string.isRequired,
  description: PropTypes.string.isRequired,
  title: PropTypes.string.isRequired,
  price: PropTypes.number.isRequired,
  onBuyClick: PropTypes.func.isRequired,
};

function Store() {
  const products = [...Array(7)].map((_, index) => ({
    id: index,
    image: ball1,
    description: 'World 2023',
    title: 'Messi\'s ball',
    price: 4,
  }));

  const handleBuyClick = (productId) => {
    // Add logic for handling the buy button click
    console.log(`Buy button clicked for product with id ${productId}`);
  };

  return (
    <div className="store1">
      <section className="item-display-sec">
        <div className="products">
          {products.map((product) => (
            <ProductCard key={product.id} {...product} onBuyClick={handleBuyClick} />
          ))}
        </div>
      </section>
    </div>
  );
}

export default Store;
